export function datosCategorias(category) {
  return categorias.filter(categoria => categoria.modulo == category);
}

export function obtenerCategoriaDeDato(dato) {
  const categoria = datos.categorias.find(c => c.id == dato.categoria);
  return categoria ? categoria : 'Categoría no encontrada';
}

export function categoriesById(category) {
  return {
    category: categorias.find(cat => cat.id == category),
    datos: datos.filter(dato => dato.categoria == category)
  }
}